import logo from './logo.svg';
import './styles.css';
import Home from './home';
function App() {
  return (
    <div className="App">
      <header className="header">
        <h1>This is MovieDux app</h1>
      </header>
      <footer className='footer'>This is MovieDux footer</footer>
    </div>
  );
}

export default App;
